import React from 'react';
import { LanguagesContainer, LanguageButton } from '../../styles/styles';
import { useTranslation } from 'react-i18next';

const Language = ({ changeLanguage }) => {
	const { t, i18n } = useTranslation();
	console.log(Object.entries(t('languages', { returnObjects: true })));
	return (
		<LanguagesContainer>
			{Object.values(t('languages', { returnObjects: true })).map((language) => (
				<LanguageButton
					key={language}
					onClick={() => {
						changeLanguage(language);
					}}>
					{language}
				</LanguageButton>
			))}
		</LanguagesContainer>
	);
};

export default Language;
